CREATE TABLE payinfo 
(
    EMPLOYEE_NO	INT NOT NULL,
    REGULAR_PAY	DOUBLE  NOT NULL,
    OVERTIME_PAY	VARCHAR(512),
    ALL_OTHER_PAY	VARCHAR(512),
    TOTAL_PAY	DOUBLE  NOT NULL,
    CITY_RETIREMENT_CONTRIBUTIONS	DOUBLE  NOT NULL,
    BENEFIT_PAY	DOUBLE  NOT NULL, 
    FOREIGN KEY (EMPLOYEE_NO) REFERENCES employee_info(EMPLOYEE_NO)
);

